import React, { Component } from 'react';
import './Movie.css';

class Movie extends Component {
  render() {
    return (
      <div >
          <MoviePoster/>
      </div>
    );
  }
}

class MoviePoster extends Component{
  render(){
    return (
      <img src = "https://yts.lt/assets/images/movies/toy_story_4_2019/medium-cover.jpg"/>
    )
  }
}

export default Movie;
